import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import { iFrame } from '../iframe';

export default function Patch_notes() {
  return (
    <>
      <body className='patch-notes'>
        <iFrame>
          <button onClick={() => window.open("https://euw.leagueoflegends.com/fr-fr/news/tags/patch-notes","_parent")}>Acc√©der aux notes de patch</button>
        </iFrame>
      </body>
      <Footer />
    </>
  )
}
